import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { Toaster } from 'react-hot-toast';
import Layout from './components/Layout/Layout';
import StudentDashboard from './pages/dashboard/StudentDashboard';
import SubmitReport from './pages/student/SubmitReport';
import RegisterInternship from './pages/student/RegisterInternship';
import MentorEvaluation from './pages/student/MentorEvaluation';
import TeacherEvaluation from './pages/student/TeacherEvaluation';
import EditProfile from './pages/student/EditProfile';
import PreliminaryCheck from './pages/student/PreliminaryCheck';
import InternshipDuration from './pages/student/InternshipDuration';
import Home from './pages/Home';
import Login from './pages/auth/Login';
import Register from './pages/auth/Register';
import ProtectedRoute from './components/Auth/ProtectedRoute';
import './styles/global.css';

function App() {
  return (
    <Router>
      <Toaster position="top-right" />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/dashboard/*" element={
          <ProtectedRoute>
            <Layout>
              <Routes>
                <Route index element={<StudentDashboard />} />
                <Route path="submit-report" element={<SubmitReport />} />
                <Route path="register-internship" element={<RegisterInternship />} />
                <Route path="mentor-evaluation" element={<MentorEvaluation />} />
                <Route path="teacher-evaluation" element={<TeacherEvaluation />} />
                <Route path="edit-profile" element={<EditProfile />} />
                <Route path="preliminary-check" element={<PreliminaryCheck />} />
                <Route path="internship-duration" element={<InternshipDuration />} />
              </Routes>
            </Layout>
          </ProtectedRoute>
        } />
      </Routes>
    </Router>
  );
}

export default App;
